import React from 'react'
import { Link } from "react-router-dom"

export const Nav = () =>{

    const logout = () => { 
        function logout() {
            localStorage.removeItem("token");
            localStorage.removeItem("user");
            setUserState({
              user: {},
              token: "",
            });
          }
    }
    return (
        <div>
            <Link to="/Feed">Feed</Link>
            <Link to="/Profile">Profile</Link>
            <button onClick={logout}>Logout</button>
        </div>
    )
}
